sys_variable_value.value:
(function execute(inputs, outputs) {
var receipt = JSON.parse(inputs.responseBody).result;

inputs.tx.receipt = JSON.stringify(receipt);
inputs.tx.contract_address = receipt.contractAddress;
inputs.tx.status = receipt.contractAddressstatus;
inputs.tx.update();


outputs.receipt = JSON.stringify(receipt);

})(inputs, outputs);

